import { Button, Card, CardContent, TextField } from '@mui/material';
import React from 'react';
import { Box } from '@mui/system';
export default function Login() {
    return (
        <Card sx={{width:400}}>
            <CardContent>
        <Box sx={{
            '& .MultiTextField-root': {
                mari: 1,
                width:'90%'
            }
        }}>
      <form noValidate autocomplete="off">
          <TextField
              label="Email"
              name="email"
              variant="outlined" />
          <TextField
              label="Name"
              name="name"
              variant="outlined" />
          <Button
                    type="submit"
                    variant="contained"
                    size="large"
                    sx={{width:'90%'}}>Start</Button> 

      </form>
        </Box>
        </CardContent >
    </Card>
  )
}
